import React from "react";
import { Container } from "react-bootstrap";

const aboutMe = (props) => (
    <Container>
       <h3 className="AboutMeHead">About Me</h3>
       <h5>{props.aboutMe}</h5> 
    </Container>
)

export default aboutMe;
